import React from 'react';
import Auth from '../Auth';
import s from '../styles/Start.module.css';
import { Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Search from './components/Search';
import Upload from './components/Upload';
import Profile from './components/Profile/Profile';

const Start = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapper}>
        <h1 style={{ color: 'white', margin: '0px', textAlign: 'center' }}>
          Welcome to Venus
        </h1>
        <p
          style={{
            color: 'white',
            margin: '0px',
            marginTop: '7px',
            textAlign: 'center'
          }}
        >
          Venus is a digital technology that facilitates the sharing of content,
          multimedia, and information through virtual networks and communities.
        </p>
        <br />
        <Auth />
      </div>
      <Routes>
        <Route exact path="/home" element={<Home />} />
        <Route path="/search" element={<Search />} />
        <Route path="/upload" element={<Upload />} />
        <Route path="/account" element={<Auth />} />
        <Route path="./profile" element={<Profile />} />
      </Routes>
    </div>
  );
};

export default Start;
